Do you focus on your heart when anxious? When I was in the middle of panic disorder I became ‘obsessed’ with the heart number on my fitness watch. Every time I felt anxiety I would instantly look at my watch and ‘worry’ that my heart rate had increased. I would then fixate on the number, waiting anxiously for the number to drop. It seemed like forever! Little did I know that by doing this I was actually increasing the anxiety and making the anxiety response last longer than it would!!! The complete opposite to what I was trying to achieve!! Anxiety has a tendency to make us FIXATE and ZONE in on our misinterpretation of danger. It’s ok to sit with the heart flutters/increased anxiety. By changing your relationship to the anxious response you can over time reduce the duration and strength of it.
It goes without saying any undiagnosed heart flutters or changes make sure to get them checked by a doc before putting it down to anxiety.
